import React,{useState} from 'react'

export const Select = () => {
    const [select,setSelect] = useState("");
    const [from,setFrom] = useState("");
    const [where,setWhere] = useState("");
    const onSubmitForm = async(e)=>{
        e.preventDefault();
        try {
            const body = select + "/" + from + "/" + where;
            console.log("aa")
            const response = await fetch("http://localhost:5321/game/get/" + body);
            const jsonData = await response.json();
            console.log(jsonData);
        } catch (error) {
            console.log("error")
            console.log(error.message)
        }
    }
  return (
    <div>
        <form onSubmit={onSubmitForm}>
            <div className='box'>
                <p>Select</p>
                <input type={"text"} value={select} onChange={e=>{setSelect(e.target.value)}}/>
            </div>
            <div className='box'>
                <p>From</p>
                <input type={"text"} value={from} onChange={e=>{setFrom(e.target.value)}}/>
            </div>
            <div className='box'>
                <p>Where</p>
                <input type={"text"} value={where} onChange={e=>{setWhere(e.target.value)}}/>
            </div>
            <button>submit</button>
        </form>
    </div>
  )
}
